import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import Ident from '../Identification/Identification'


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/x">
        Nic

          <BrowserRouter>
          <Switch>
          <Route path="/y">
          XY
          </Route>
          </Switch>
          </BrowserRouter>

        </Route>

        <Route path="/test">
        Test
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
